INSERT INTO `tbl_data` VALUES ('5', 'Getting and Saving Data in CKEditor old2', 'getting-and-saving-data-in-ckeditor-old2', 'a:8:{s:6:\"text02\";s:423:\"CKEditor helps you create content but it is the role of your website or application to deal with the data created in this way. Saving data is a server-side operation and you are free to implement the save functionality on your own, in any way you like. CKEditor is a pure JavaScript component and it does not offer anything more than JavaScript methods and events to access the data so that you could save it on the server.\";s:6:\"html03\";s:1326:\"<h2>Retrieving Data from CKEditor</h2>\n\n<p>Some applications need to handle all data on the client side, sending it to the server using their specific methods. This is what usually happens in <a href=\"http://docs.ckeditor.com/#!/guide/dev_inline\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">inline editing</a> — with the possibility to <a href=\"http://docs.ckeditor.com/#!/api/CKEDITOR-method-inline\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">create</a> and <a href=\"http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-destroy\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">destroy</a> CKEditor instances dynamically, CKEditor is a perfect match for Ajax applications. If this is the case, it is enough to use the JavaScript API methods to easily retrieve the editor instance data.</p>\n\n<p>To retrieve the editor data, call the <a class=\"docClass\" href=\"http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-getData\" rel=\"CKEDITOR.editor-method-getData\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">CKEDITOR.editor.getData</a> method of the editor instance. For an editor instance with an ID of editor1, this would look like the following:</p>\n\";s:8:\"field_01\";s:44:\"Saving Data in CKEditor Replacing a Textarea\";s:8:\"field_04\";s:129:\"http://www.gravatar.com/avatar/a53aed2b7c6e69fecd5a8338158a440f.jpg?d=http%3A//c.cksource.com/a/1/img/default_avatar.png&s=83&r=G\";s:8:\"field_05\";s:9:\"field_051\";s:8:\"field_06\";s:1:\"1\";s:8:\"field_08\";s:4:\"f081\";s:8:\"field_07\";a:2:{i:0;s:4:\"f071\";i:1;s:4:\"f072\";}}', '2017-05-07 21:31:48', '2017-05-15 12:02:30', 'news', '1', '10', null, 'a:1:{s:8:\"field_10\";a:2:{i:0;a:3:{s:5:\"alias\";s:11:\"img-0111122\";s:5:\"title\";s:11:\"Img 0111122\";s:5:\"image\";s:129:\"http://www.gravatar.com/avatar/a53aed2b7c6e69fecd5a8338158a440f.jpg?d=http%3A//c.cksource.com/a/1/img/default_avatar.png&s=83&r=G\";}i:1;a:3:{s:5:\"alias\";s:4:\"3333\";s:5:\"title\";s:4:\"3333\";s:5:\"image\";s:4:\"4444\";}}}', '1', '4');
INSERT INTO `tbl_data` VALUES ('6', 'Getting and Saving Data in CKEditor', 'getting-and-saving-data-in-ckeditor', 'a:8:{s:6:\"text02\";s:423:\"CKEditor helps you create content but it is the role of your website or application to deal with the data created in this way. Saving data is a server-side operation and you are free to implement the save functionality on your own, in any way you like. CKEditor is a pure JavaScript component and it does not offer anything more than JavaScript methods and events to access the data so that you could save it on the server.\";s:6:\"html03\";s:1326:\"<h2>Retrieving Data from CKEditor</h2>\n\n<p>Some applications need to handle all data on the client side, sending it to the server using their specific methods. This is what usually happens in <a href=\"http://docs.ckeditor.com/#!/guide/dev_inline\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">inline editing</a> — with the possibility to <a href=\"http://docs.ckeditor.com/#!/api/CKEDITOR-method-inline\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">create</a> and <a href=\"http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-destroy\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">destroy</a> CKEditor instances dynamically, CKEditor is a perfect match for Ajax applications. If this is the case, it is enough to use the JavaScript API methods to easily retrieve the editor instance data.</p>\n\n<p>To retrieve the editor data, call the <a class=\"docClass\" href=\"http://docs.ckeditor.com/#!/api/CKEDITOR.editor-method-getData\" rel=\"CKEDITOR.editor-method-getData\" style=\"box-sizing: border-box; color: rgb(12, 127, 204); text-decoration-line: none;\">CKEDITOR.editor.getData</a> method of the editor instance. For an editor instance with an ID of editor1, this would look like the following:</p>\n\";s:8:\"field_01\";s:44:\"Saving Data in CKEditor Replacing a Textarea\";s:8:\"field_04\";s:129:\"http://www.gravatar.com/avatar/a53aed2b7c6e69fecd5a8338158a440f.jpg?d=http%3A//c.cksource.com/a/1/img/default_avatar.png&s=83&r=G\";s:8:\"field_05\";s:9:\"field_051\";s:8:\"field_06\";s:1:\"1\";s:8:\"field_08\";s:4:\"f081\";s:8:\"field_07\";a:2:{i:0;s:4:\"f071\";i:1;s:4:\"f072\";}}', '2017-05-07 21:57:28', '2017-05-15 11:59:12', 'news', '1', '13', null, 'a:1:{s:8:\"field_10\";a:1:{i:0;a:3:{s:5:\"alias\";s:7:\"img-011\";s:5:\"title\";s:7:\"Img 011\";s:5:\"image\";s:129:\"http://www.gravatar.com/avatar/a53aed2b7c6e69fecd5a8338158a440f.jpg?d=http%3A//c.cksource.com/a/1/img/default_avatar.png&s=83&r=G\";}}}', '9', '5');
